class Display extends React.Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div>
        <label>Temprature: </label>
        <p id="tempDisplay">temp</p>
        <label>conditions: </label>
        <p id="conditions">cond</p>
        <label>humidity: </label>
        <p id="humidity">humi</p>
      </div>
    );
  }
}

export default Display;
